// LatestProperties.js
import React from "react";

const LatestProperties = () => {
  const containerStyle = {
    display: "flex",
    flexDirection: "column",
    alignItems: "center",
    fontFamily: "Arial, sans-serif",
    padding: "40px 20px",
    textAlign: "center",
  };

  const imagesContainer = {
    position: "relative",
    marginBottom: "20px",
  };

  const imageStyle1 = {
    width: "150px",
    height: "100px",
    borderRadius: "10px",
    objectFit: "cover",
    position: "absolute",
    left: "0",
    top: "0",
    boxShadow: "0 4px 8px rgba(0,0,0,0.2)",
  };

  const imageStyle2 = {
    width: "150px",
    height: "100px",
    borderRadius: "10px",
    objectFit: "cover",
    position: "absolute",
    left: "50px",
    top: "20px",
    boxShadow: "0 4px 8px rgba(0,0,0,0.2)",
  };

  const topHeadingStyle = {
    fontSize: "24px",
    fontWeight: "bold",
    marginBottom: "30px",
  };

  const infoContainer = {
    display: "flex",
    justifyContent: "center",
    gap: "40px",
    flexWrap: "wrap",
    marginTop: "20px",
  };

  const infoBoxStyle = {
    maxWidth: "200px",
    textAlign: "left",
  };

  const iconStyle = {
    fontSize: "24px",
    marginRight: "10px",
    verticalAlign: "middle",
  };

  const infoHeadingStyle = {
    fontSize: "18px",
    fontWeight: "bold",
    margin: "5px 0",
  };

  const infoTextStyle = {
    fontSize: "14px",
    color: "#555",
  };

  return (
    <div style={containerStyle}>
      {/* Top Heading */}
      <h2 style={topHeadingStyle}>
        We provided latest properties for our valuable clients
      </h2>

      {/* Images */}
      <div style={imagesContainer}>
        <img
          src="https://via.placeholder.com/150x100?text=Property+1"
          alt="Property 1"
          style={imageStyle1}
        />
        <img
          src="https://via.placeholder.com/150x100?text=Property+2"
          alt="Property 2"
          style={imageStyle2}
        />
      </div>

      {/* Info Boxes */}
      <div style={infoContainer}>
        {/* Budget-friendly */}
        <div style={infoBoxStyle}>
          <div>
            <span style={iconStyle}>üí∞</span>
            <span style={infoHeadingStyle}>Budget-Friendly</span>
          </div>
          <p style={infoTextStyle}>Affordable options for all budgets.</p>
          <p style={infoTextStyle}>Find your perfect property easily.</p>
        </div>

        {/* Trusted by Thousands */}
        <div style={infoBoxStyle}>
          <div>
            <span style={iconStyle}>ü§ù</span>
            <span style={infoHeadingStyle}>Trusted by Thousands</span>
          </div>
          <p style={infoTextStyle}>Our clients love us worldwide.</p>
          <p style={infoTextStyle}>Reliable and professional service.</p>
        </div>

        {/* Prime Location */}
        <div style={infoBoxStyle}>
          <div>
            <span style={iconStyle}>üìç</span>
            <span style={infoHeadingStyle}>Prime Location</span>
          </div>
          <p style={infoTextStyle}>Properties in top areas.</p>
          <p style={infoTextStyle}>Convenience and accessibility guaranteed.</p>
        </div>
      </div>
    </div>
  );
};

export default LatestProperties;
